    fun countSubstringOccurrences(text: String, substring: String): Float {
        var count = 0.0f
        var currentIndex = 0

        while (currentIndex < text.length) {
            val index = text.indexOf(substring, currentIndex)
            if (index != -1) {
                count++
                currentIndex = index + substring.length
            } else {
                break
            }
        }
        return count
    }

    val stochiometry = Stochiometry()

    @Test
    fun findLimitingReagentIndex_validInput_returnsCorrectIndex() {
        // Test case 1: 2 H2 + O2 -> 2 H2O, H2 is limiting
        val molecules1 = listOf(
            MoleculeEntry("H2", 2.0f, 2.016f, 2f, 2.0f),
            MoleculeEntry("O2", 1.0f, 32.0f, 1f, 1.0f),
            MoleculeEntry("H2O", 0f, 18.015f, 2f, 0f)
        )
        assertEquals("Test Case 1 Failed: H2 is limiting",0, stochiometry.findLimitingReagentIndex(molecules1,2))

        // Test case 2: 2 H2 + O2 -> 2 H2O, O2 is limiting
        val molecules2 = listOf(
            MoleculeEntry("H2", 2.0f, 2.016f, 2f, 4.0f),
            MoleculeEntry("O2", 1.0f, 32.0f, 1f, 1.5f),
            MoleculeEntry("H2O", 0f, 18.015f, 2f, 0f)
        )
        assertEquals(
            "Test Case 2 Failed: O2 is limiting",
            1,
            stochiometry.findLimitingReagentIndex(molecules2,2)
        )

        // Test case 3: N2 + 3 H2 -> 2 NH3, N2 is limiting
        val molecules3 = listOf(
            MoleculeEntry("N2", 10.0f, 28.013f, 1f, 10.0f),
            MoleculeEntry("H2", 20.0f, 2.016f, 3f, 20.0f),
