            stochiometry.findLimitingReagentIndex(molecules3,2)
        )

        //Test case 4: N2 + 3 H2 -> 2 NH3, H2 is limiting
        val molecules4 = listOf(
            MoleculeEntry("N2", 5.0f, 28.013f, 1f, 5.0f),
            MoleculeEntry("H2", 16.0f, 2.016f, 3f, 16.0f),
            MoleculeEntry("NH3", 0f, 17.034f, 2f, 0f)
        )
        assertEquals(
            "Test Case 4 Failed: H2 is limiting",
            1,
            stochiometry.findLimitingReagentIndex(molecules4,2)
