        // Test Case 5: Larger reaction: 4 NH3 + 5 O2 -> 4 NO + 6 H2O, O2 is limiting
        val molecules5 = listOf(
            MoleculeEntry("NH3", 20.0f, 17.031f, 4f, 20.0f),
            MoleculeEntry("O2", 24.0f, 32.0f, 5f, 24.0f),
            MoleculeEntry("NO", 0f, 30.01f, 4f, 0f),
            MoleculeEntry("H2O", 0f, 18.015f, 6f, 0f)
        )
        assertEquals(
            "Test Case 5 Failed: O2 is limiting in larger reaction",
            1,
            stochiometry.findLimitingReagentIndex(molecules5,2)
        )

        // Test Case 6: Larger reaction: 4 NH3 + 5 O2 -> 4 NO + 6 H2O, NH3 is limiting
        val molecules6 = listOf(
            MoleculeEntry("NH3", 10.0f, 17.031f, 4f, 10.0f),
            MoleculeEntry("O2", 15.0f, 32.0f, 5f, 15.0f),
            MoleculeEntry("NO", 0f, 30.01f, 4f, 0f),
            MoleculeEntry("H2O", 0f, 18.015f, 6f, 0f)
        )
        assertEquals(
            "Test Case 6 Failed: NH3 is limiting in larger reaction",
            0,
            stochiometry.findLimitingReagentIndex(molecules6,2)
        )
    }
}